                    blue <= pixel_x[8:5]; 
                end
                else if(((pixel_x >= 438 && pixel_y <= 60) || (pixel_x >= 560 && pixel_y <= 170)) ||
                        ((pixel_x <= 100 && pixel_y >= 300) || (pixel_x <= 200 && pixel_y >= 400))) begin
                            red <= `ONES;  
                            green <= `ONES; 
                            blue <= `ONES; 
                        end
                else begin
                    case(choise)
                        0: begin
                            if(pixel_y >= 150 && pixel_y <= 200) begin
                                red <= `ONES;   
                                green <= `ZEROS;  
                                blue <= `ZEROS; 
                            end
                            else begin
                                red <= `ZEROS; 
                                green <= `ZEROS;  
                                blue <= `ONES;  
                            end
                        end
                        1: begin
                            if(pixel_y >= 230 && pixel_y <= 270) begin
                                red <= `ONES;   
                                green <= `ZEROS; 
                                blue <= `ZEROS; 
                            end
                            else begin
                                red <= `ZEROS; 
                                green <= `ZEROS;  
                                blue <= `ONES; 
                            end
                        end
                        2: begin
                            if(pixel_y >= 300 && pixel_y <= 350) begin
                                red <= `ONES;  
                                green <= `ZEROS;  
                                blue <= `ZEROS; 
                            end
                            else begin
                                red <= `ZEROS;  
                                green <= `ZEROS; 
                                blue <= `ONES; 
                            end
                        end
    //                    3: begin
    //                        red <= `ONES;  
    //                        green <= `ONES;  
    //                        blue <= `ZEROS; 
    //                    end
                    endcase
                end
            end 
            else begin
                red <= `ONES;  
                green <= `ONES;  
                blue <= `ZEROS; 
            end 
        end   
        else begin //  
            red <= `ZEROS;  
            green <= `ZEROS;    
            blue <= `ZEROS;  
        end
    end
end  
endmodule